import React from 'react'
import Head from 'next/head'

const Home = () => (
  <div>
    <Head>
      <title>Sup Safari - Supturer Fredrikstad/Hvaler</title>
      <meta name="description" content="SUP Safari tilbyr SUP-utleie og SUP-turer i Fredrikstad skjærgården og på Hvaler."/>
      <meta name="keywords" content="Paddleboard Fredrikstad, SUP Østfold, SUP Hvaler, SUP Rentals, surf, Supbrett Fredrikstad, suputleie, supturer, utleie."/>

      <link rel='icon' href='/favicon.ico' />
    </Head>



    <div className='hero'>
    <img className="logo" width="90%" src="/logo.svg"  alt="sup safari logo" />
      <p className='description'>
        SUP safari tilbyr utleie av SUP og SUPturer i Fredrikstad og på Hvaler.
      </p>
      <h2>Meld interesse:</h2>

  <form name="contact" method="POST" data-netlify="true">
  <p>
    <label>Fornavn: <input type="text" name="name" /></label>   
  </p>
  <p>
    <label>Etternavn: <input type="email" name="email" /></label>
  </p>
  <p>
    <label>Epost: <input type="email" name="email" /></label>
  </p>


  <p>
    <button type="submit">Send</button>
  </p>
</form>
    </div>

    <style jsx>{`

      :global(body) {
        margin: 0;
        font-family: -apple-system, BlinkMacSystemFont, Avenir Next, Avenir,
        Helvetica, sans-serif;
        background: tomato;
        color: white;
        padding: 1rem;
      }

      .logo img{
        max-width: 800px
      }

      button{
        background: #2d2d2d;
        outline: none;
        border-radius: 3px;
        width: 100%;
        padding: .5rem;
        color: #fff;
        border: none;
        text-transform: uppercase;
        font-style: italic;
      }

      input{
        width: 100%;
        padding: .3rem;
        margin: .2rem 0rem;
      }
      .hero {
        width: 100%;
        display: flex;
        min-height: 100vh;
        flex-direction: column;
        justify-content: center;
        align-items: center;

      }
      .title {
        margin: 0;
        width: 100%;
        padding-top: 80px;
        line-height: 1.15;
        font-size: 48px;
      }
      .title,
      .description {
        text-align: center;
        font-size: 1.2rem
        line-height: 1.6rem;
      }
    `}</style>
  </div>
)

export default Home
